eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"parasitos\": () => (/* binding */ parasitos)\n/* harmony export */ });\nconst parasitos = [\n    {\n        id: \"C1\",\n        nombre: \"Toxoplasma gondii\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Intracelular obligado.\",\n        codigoPatogeno: \"• Oido - oido\",\n        conflictoBase: \"Conflictos del grupo no resueltos y que se mantienen en secreto. Negaci\\xf3n.\",\n        notas: \"Las infecciones por T. gondii tienen la facultad de cambiar el comportamiento de ratas y ratones, haciendo que se acerquen, en vez de huir del olor de los gatos.\"\n    },\n    {\n        id: \"C2\",\n        nombre: \"Plasmodium sp.\",\n        nombreCientifico: \"P. ovale, P.Vivax, P. falciparum\",\n        tipo: \"Parasito\",\n        descripcion: \"Tiene dos huespedes: Un mosquito y un huesped vertebrado.\",\n        codigoPatogeno: \"• Pomulo izquierdo - ri\\xf1\\xf3n derecho\",\n        conflictoBase: \"Conflicto de sangre (familia). El sentido del grupo. Lazo patol\\xf3gico. Triangulo dram\\xe1tico de Karpman.\",\n        notas: \"Fibromialgia. Artritis. Fiebre. Anemia.\"\n    },\n    {\n        id: \"C3\",\n        nombre: \"Entamoeba histolytica\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Anaerobio de forma ameboide.\",\n        codigoPatogeno: \"• Parietal izquierdo - ri\\xf1\\xf3n izquierdo\\n• P\\xedloro - ri\\xf1\\xf3n izquierdo\\n• H\\xedgado - ri\\xf1\\xf3n izquierdo\",\n        conflictoBase: \"Invasi\\xf3n del grupo. Mis parientes me invaden. Me siento invadido y no puedo recharzarle. Se aprovechan de mi. Lazo patol\\xf3gico. Me siento agotado.\",\n        notas: \"Diarrea aguda. Dolor abdominal. Colitis. Lesiones ulcerosas del epitelio colonico. Disenter\\xeda.\"\n    },\n    {\n        id: \"C4\",\n        nombre: \"Sarcoptes scabiei\",\n        nombreCientifico: \"\\xc1caro\",\n        tipo: \"Parasito\",\n        descripcion: \"Arador de la sarna. Cuerpo no segmentado, ovoide, con cuatro pares de patas.\",\n        codigoPatogeno: \"• Lengua - lengua\",\n        conflictoBase: \"Doble conflicto. La soluci\\xf3n de uno complica a el otro. Separaci\\xf3n dolorosa.\",\n        notas: \"Dermatitis. Prurito. Psoriasis.\"\n    },\n    {\n        id: \"C5\",\n        nombre: \"Filaria sp.\",\n        nombreCientifico: \"Nematodo\",\n        tipo: \"Parasito\",\n        descripcion: \"Son transmitidos en forma de larva o microfilaria a los vertebrados por un artr\\xf3podo.\",\n        codigoPatogeno: \"• Mastoides - mastoides\",\n        conflictoBase: \"Conflicto de lazo patol\\xf3gico. Par\\xe1sitos familiares.\",\n        notas: \"Elefantiasis. Dermatitis. Edema.\"\n    },\n    {\n        id: \"C6\",\n        nombre: \"Blastocystis hominis\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Se distinguen las formas esquizonte y trofozo\\xedto.\",\n        codigoPatogeno: \"• Cuello - cuello\",\n        conflictoBase: \"Reconfiguraci\\xf3n de quien soy en el grupo. Plaza y reconocimiento.\",\n        notas: \"Diarrea, inflamaci\\xf3n intestinal.\"\n    },\n    {\n        id: \"C7\",\n        nombre: \"Balantidium Coli\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Ciliado. La transmisi\\xf3n es fecal-oral. Es el protozoario de mayor tama\\xf1o entre los que parasitan al hombre; el trofozo\\xedto puede llegar a medir hasta 870μm.\",\n        codigoPatogeno: \"• Cervical 3\\xaa o 4\\xaa - suprarrenal\",\n        conflictoBase: \"Reconfiguraci\\xf3n de quien soy en el grupo. Enojo indigesto con el grupo o la sociedad.\",\n        notas: \"Los cerdos son los reservorios m\\xe1s comunes, aunque muy pocos presentan s\\xedntomas. Diarrea. Inflamaci\\xf3n intestinal.\"\n    },\n    {\n        id: \"C8\",\n        nombre: \"Trypanosoma cruzi\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Caracterizado por un solo flagelo y una sola mitocondria. Intracelular.\",\n        codigoPatogeno: \"Costodiafragm\\xe1tico - costadiafragm\\xe1tico\",\n        conflictoBase: \"Confundido,Fuera de centro, Lastimado, el coraz\\xf3n roto, sufriente. Memorias transgeneracionales que afectaron el coraz\\xf3n, de invasi\\xf3n, de abuso.\",\n        notas: \"Genera megacolon, megaesofago, cardiomegalia. Enfermedad de Chagas. Afecciones cardiacas: Cardiomiopat\\xeda.\"\n    },\n    {\n        id: \"C9\",\n        nombre: \"Fasciolopsis buski\",\n        nombreCientifico: \"Platelminto\",\n        tipo: \"Parasito\",\n        descripcion: \"Trematodo (duela) de forma lanceolada, con dos ventosas, una bucal y otra ventral.\",\n        codigoPatogeno: \"• Es\\xf3fago - es\\xf3fago\",\n        conflictoBase: \"Violaci\\xf3n de la ley interior. Enojo con el grupo. Conflicto de c\\xf3lera territorial.\",\n        notas: \"Dolor vesicular. Inflamaci\\xf3n de v\\xedas biliares. Afecciones gastrointestinales.\"\n    },\n    {\n        id: \"C10\",\n        nombre: \"Enterobius vermicularis\",\n        nombreCientifico: \"Nematodo\",\n        tipo: \"Parasito\",\n        descripcion: \"Fusiforme de coloraci\\xf3n blanco nacarado. Tambi\\xe9n denominado oxiuro.\",\n        codigoPatogeno: \"• P\\xedloro - h\\xedgado\",\n        conflictoBase: \"Conflicto con el grupo. Ira acumulada. Enojo con un miembro del grupo. Tolerancia llevada al m\\xe1ximo.\",\n        notas: \"Inflamaci\\xf3n gastrointestinal. Hepatitis. Bruxismo. Nausea.\"\n    },\n    {\n        id: \"C11\",\n        nombre: \"Trichinella spiralis\",\n        nombreCientifico: \"Nematodo\",\n        tipo: \"Parasito\",\n        descripcion: \"Se trasmite por carne cruda.\",\n        codigoPatogeno: \"• P\\xedloro - lengua\",\n        conflictoBase: \"Conflicto de lazo patol\\xf3gico. No poder soportar una situaci\\xf3n en el grupo. Invasi\\xf3n insoportable en negaci\\xf3n.\",\n        notas: \"Mialgias. Dolor general.\"\n    },\n    {\n        id: \"C12\",\n        nombre: \"Trichomona sp.\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Presenta un tama\\xf1o 10-20 μm de longitud y una morfolog\\xeda piriforme. Carece de mitocondrias y posee en su lugar hidrogenosomas.\",\n        codigoPatogeno: \"• Ciego - ri\\xf1\\xf3n derecho\\n• Valv\\xfala ileocecal - ri\\xf1\\xf3n derecho\",\n        conflictoBase: \"Memorias conflictivas de experiencias sexuales con enojo, desconfianza, rechazo. Sentirse usado. Experiencias sexuales que no se han asimilado, no dichas.\",\n        notas: \"Los hidrogenosomas catalizan la formaci\\xf3n de ATP en condiciones anaerobicas. Afecciones relacionadas: Procesos inflamatorios de mucosas genitales. Vulvovaginitis. Prurito vulvar. Uretritis. Prostatitis. Epididimitis.\"\n    },\n    {\n        id: \"C13\",\n        nombre: \"Schistosoma\",\n        nombreCientifico: \"Platelminto\",\n        tipo: \"Parasito\",\n        descripcion: \"De la clase trematodos, comunmente llamados bilharzia.\",\n        codigoPatogeno: \"• Colon descendente - cuadriceps\",\n        conflictoBase: \"Tolerancia llevada al extremo. Experiencias en el grupo dif\\xedcil de asimilar. Exclusi\\xf3n.\",\n        notas: \"Dermatitis. Granulomas. Fiebre de Katayama. Hipertensi\\xf3n portal. Hematuria. Afecci\\xf3n vesical. Neumonitis. Sindrome de Loeffler. Disenter\\xeda. Polipos colonicos. Glomerulonefritis.\"\n    },\n    {\n        id: \"C14\",\n        nombre: \"Parasitos intestinales\",\n        nombreCientifico: \"Helmintos\",\n        tipo: \"Parasito\",\n        descripcion: \"El t\\xe9rmino helminto (del griego έλμινθος h\\xe9lminthos, 'gusano') es en principio un sin\\xf3nimo de verme o gusano\",\n        codigoPatogeno: \"• Gluteo - gluteo\",\n        conflictoBase: \"Conflicto con el grupo o el otro. Tengo que tolerar a mi familia. Enojo indigesto. Experiencias no asimiladas.\",\n        notas: \"Los par\\xe1sitos helmintos, poseen la capacidad de regular (modular) la respuesta inmune del hu\\xe9sped para su beneficio. En este fen\\xf3meno por dem\\xe1s interesante, los helmintos inducen un proceso anti-inflamatorio, mediante lo cual pueden suprimir, desviar y/o convertir la respuesta inmune del hu\\xe9sped, favoreciendo su permanencia.\"\n    },\n    {\n        id: \"C15\",\n        nombre: \"Babesia (Nuttallia)\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"El par\\xe1sito es transmitido por garrapatas y ataca a los gl\\xf3bulos rojos de la sangre.\",\n        codigoPatogeno: \"• Gluteo - vena femoral\",\n        conflictoBase: \"Conflicto de sufrimiento oculto en el grupo. Vivencias no asimiladas. Exclusi\\xf3n.\",\n        notas: \"Lesiones en coraz\\xf3n, bazo, pulm\\xf3n, h\\xedgado. Glomerulonefritis. Gastritis ulcerativa. Hemorragias.\"\n    },\n    {\n        id: \"C16\",\n        nombre: \"Trypanosoma gambiensi\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"Transmitidos a los humanos por picaduras de la mosca tse-tse (g\\xe9nero Glossina).\",\n        codigoPatogeno: \"• Cresta iliaca - cresta iliaca\",\n        conflictoBase: \"Tolerancia llevada al extremo. Conflictos no asimilados en el grupo.\",\n        notas: \"Fiebre. Linfadenitis. Perdida de peso. Afecciones neurologicas. Insmonio. Coma.\"\n    },\n    {\n        id: \"C17\",\n        nombre: \"Onchocerca volvulus\",\n        nombreCientifico: \"Nematodo\",\n        tipo: \"Parasito\",\n        descripcion: \"Las hembras miden de 33 a 50 cm de largo y de 270 a 400 μm de di\\xe1metro, mientras que los machos miden de 19 a 42 mm por 130 a 210 μm.\",\n        codigoPatogeno: \"• Isqui\\xf3n - isqui\\xf3n\",\n        conflictoBase: \"Lazos pat\\xf3logicos. Conflictos antiguos y transgeneracionales no resueltos. Abuso. Ira contenida. Conflicto territorial.\",\n        notas: \"La patolog\\xeda producida por los par\\xe1sitos adultos consiste en n\\xf3dulos subcut\\xe1neos llamados oncocercomas, que est\\xe1n formados por tres partes, una c\\xe1psula fibrosa perif\\xe9rica, otra intermedia fibrosa y celular vascularizada y en el centro los par\\xe1sitos enrollados que pueden vivir 10 a\\xf1os o m\\xe1s. Fiebre. Eosinofilia. Urticaria. Conjuntivitis. Queratitis. Coriorretinitis.\"\n    },\n    {\n        id: \"C18\",\n        nombre: \"Leishmania sp.\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"El principal vector de infecci\\xf3n son los mosquitos de los g\\xe9neros Phlebotomus (en Eurasia y \\xc1frica) y Lutzomyia (en Am\\xe9rica).\",\n        codigoPatogeno: \"• Deltoides derecho - ri\\xf1\\xf3n derecho\",\n        conflictoBase: \"Sensaci\\xf3n de vacio. Angustia. Indefenso, inservible, vac\\xedo, destinado al fracaso. Exclusi\\xf3n. Sentirse atrapado en un lazo familiar.\",\n        notas: \"En la leishmaniosis cut\\xe1nea el par\\xe1sito se localiza en la piel. Despu\\xe9s de la picadura del mosquito, transcurren entre una y doce semanas para que se desarrolle una p\\xe1pula eritematosa, que crece y se ulcera, generando una costra de exudado seco. La leishmaniosis visceral se caracteriza por la inflamaci\\xf3n del h\\xedgado y del bazo, acompa\\xf1ada por distensi\\xf3n abdominal severa, p\\xe9rdida de condici\\xf3n corporal, desnutrici\\xf3n y anemia.\"\n    },\n    {\n        id: \"C19\",\n        nombre: \"Giardia lamblia\",\n        nombreCientifico: \"Protozoo\",\n        tipo: \"Parasito\",\n        descripcion: \"El an\\xe1lisis del RNA de la unidad ribosomal 16S de Giardia, indica que este protozoo se encuentra ubicado entre los eucariontes m\\xe1s primitivos.\",\n        codigoPatogeno: \"• Agujero (hiato esof\\xe1gico) - agujero\",\n        conflictoBase: \"Conflicto territorial. Sentirse invadido. Conflicto dif\\xedcil de asimilar. No poder digerir una situaci\\xf3n.\",\n        notas: \"Dolor abdominal. Diarrea. Meteorismo. Anorexia. S\\xedndrome de malabsorci\\xf3n. Alteraciones de el epitelio intestinal.\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/parasitos.js\n");

